import React, { Component } from 'react'
import PropTypes from 'prop-types'

class Tab extends Component {
  static propTypes = {
    activeTab1: PropTypes.string.isRequired,
    label1: PropTypes.string.isRequired,
    onClick1: PropTypes.func.isRequired,
    activeTab2: PropTypes.string.isRequired,
    label2: PropTypes.string.isRequired,
    onClick2: PropTypes.func.isRequired,
  }

  onClick1 = () => {
    const { label1, onClick1 } = this.props1
    onClick1(label1);
  }

  onClick2 = () => {
    const { label2, onClick2 } = this.props2
    onClick2(label2);
  }

  render() {
    const {
      onClick1,
      props1: {
        activeTab1,
        label1,
      },
      props2: {}
    } = this

    const {
      onClick2,
      props2: {
        activeTab2,
        label2,
      },
      props2: {}
    } = this

    let className1 = 'listSkillsItem'
    let inactiveTabColor1 = 'inactive-tab-color'
    let className2 = 'listSkillsItem'
    let inactiveTabColor2 = 'inactive-tab-color'

    if(activeTab1 === label1) {
      className1 += ' tab-list-active'
      inactiveTabColor1 = 'none'
    }

    if(activeTab2 === label2) {
      className2 += ' tab-list-active'
      inactiveTabColor2 = 'none'
    }

    return (
      <li>
        <span className={className1}>
          <div className={inactiveTabColor1} onClick={onClick1}>
            <button className='skillButton'>{label1}</button>
          </div>
        </span>
        <span className={className2}>
          <div className={inactiveTabColor2} onClick={onClick2}>
            <button className='skillButton'>{label2}</button>
          </div>
        </span>
      </li>
    )
  }
}

export default Tab
